def generate_paths(n):
    if n == 0:
        yield (), 0
    else:
        results = set()
        for p, last in generate_paths(n-1):
            q = tuple(sorted(p + (last,)))
            results.add((q, last+1))
            results.add((q, last-1))
        for p, last in results:
            yield p, last
def count_paths(n):
    results = set()
    for p, last in generate_paths(n):
        q = tuple(sorted(p + (last,)))
        if not (q in results):
            results.add(q)
    return len(results)
